--
-- Definition for database grovodb
--
CREATE DATABASE grovodb
CHARACTER SET utf8
COLLATE utf8_general_ci;

-- 
-- Set default database
--
USE grovodb;

--
-- Definition for table users
--
CREATE TABLE users(
  id INT(11) UNSIGNED NOT NULL AUTO_INCREMENT,
  email VARCHAR(127) NOT NULL,
  PRIMARY KEY (id),
  UNIQUE INDEX UK_users_email (email)
)
ENGINE = INNODB
AUTO_INCREMENT = 67954
AVG_ROW_LENGTH = 1260
CHARACTER SET utf8
COLLATE utf8_general_ci;

--
-- Definition for table lessonviews
--
CREATE TABLE lessonviews(
  id INT(10) UNSIGNED NOT NULL AUTO_INCREMENT,
  user_id INT(10) UNSIGNED NOT NULL,
  courselesson_id INT(10) UNSIGNED NOT NULL,
  view_timestamp TIMESTAMP DEFAULT CURRENT_TIMESTAMP COMMENT 'Date & time when lesson was viewed by user',
  PRIMARY KEY (id)
)
ENGINE = INNODB
AUTO_INCREMENT = 89598
AVG_ROW_LENGTH = 47
CHARACTER SET utf8
COLLATE utf8_general_ci;

-- 
-- Set character set the client will use to send SQL statements to the server
--
SET NAMES 'utf8';

